  gpio_init(DC);
  gpio_set_dir(DC, GPIO_OUT);
  gpio_put(DC, 1);
  gpio_init(RST);
  gpio_set_dir(RST, GPIO_OUT);
  gpio_put(RST, 0);
  sleep_ms(50);
  gpio_put(RST, 1);
  gpio_put(DC, 0);
